import React from 'react';

const AgentSearch = ({ type }) => {
    return (
        <div className="container-fluid py-5">
            <div className="card border-0 shadow-sm rounded-4 p-5 text-center">
                <i className={`fa ${type === 'hotels' ? 'fa-hotel' : 'fa-plane'} fa-5x text-primary opacity-10 mb-4`}></i>
                <h2 className="fw-bold">B2B {type.charAt(0).toUpperCase() + type.slice(1)} Search</h2>
                <p className="text-muted lead mx-auto" style={{ maxWidth: '600px' }}>
                    Our premium B2B {type} search engine is being integrated.
                    Soon you will be able to book from our exclusive global inventory with special partner rates.
                </p>
                <div className="mt-4">
                    <button className="btn btn-primary rounded-pill px-5 py-3 fw-bold shadow-sm">
                        Request API Early Access
                    </button>
                </div>
            </div>
        </div>
    );
};

export default AgentSearch;
